import React from "react";

import { BasicLayout } from "../../layout";
import { Descriptors } from "../../organisms";

import Icons from "../../../resources/icons";
import "./index.scss";

// missionVision
export const MissionVision = (props) => {
  const descriptors = {
    price: "Más barato del mercado",
    service: "Los mejores proveedores",
    comfort: "Máxima comodidad",
    scope: "Alcance global",
  };

  return (
    <BasicLayout>
      <div id="about-us" className="box">
        <h2>
          <span style={{ color: "#7ed9d9" }}>Misión y</span> visión
        </h2>
        <div className="vision-mision-container box">
          <div className="box border-radius">
            <object className="eye-icon" data={Icons.eye} type="image/svg+xml">
              <img alt="descriptor" src={Icons.eye} />
            </object>
            <span style={{ color: "#7ed9d9" }}>Misión</span>
            <p>
              Ser la compañía más enfocada en satisfacción al cliente, donde
              puedan encontrar y descubrir cualquier servicio que deseen
            </p>
          </div>
          <div className="box border-radius">
            <object
              className="mision-icon"
              data={Icons.mision}
              type="image/svg+xml"
            >
              <img alt="descriptor" src={Icons.mision} />
            </object>
            <span style={{ color: "#7ed9d9" }}>Visión</span>
            <p>
              Nos esforzamos por ofrecer a nuestros clientes servicios a los
              precios más bajos posibles, la mejor selección disponible y la
              mayor comodidad
            </p>
          </div>
        </div>
        <div className="descriptors-container">
          <Descriptors {...descriptors} />
        </div>
      </div>
    </BasicLayout>
  );
};
